import React from 'react';
import TradingViewWidget, { Themes } from 'react-tradingview-widget';
import '../Tools/live.css';

 
import { MyfxbookApi } from 'myfxbook-api-client';

const Calendar = () => (                           
  <div>
  <script type="text/javascript" 
  src="https://widgets.myfxbook.com/scripts/fxCalendar.js?ps=20"></script>
 <div>Powered by <a href="https://www.myfxbook.com"class="myfxbookLink" ><b>Myfxbook.com</b></a></div>
 <script type="text/javascript">showCalendarWidget()</script></div>



);
export default Calendar;
